import styles from "./burgerMenu.module.css"

export const BurgerMenu = () => {
    return (
        <div className={styles.burgerMenu}>
            <div className={styles.burgerBlock}>
                <div className={styles.line}></div>
                <div className={styles.line}></div>
                <div className={styles.line}></div>
            </div>
        </div>
    )
}
